import React, { useState, useEffect } from "react";
import { Link, useNavigate } from "react-router-dom";
import axios from "axios";
import { Button } from "react-bootstrap";
import Table from "@mui/material/Table";
import TableBody from "@mui/material/TableBody";
import TableCell from "@mui/material/TableCell";
import TableContainer from "@mui/material/TableContainer";
import TableHead from "@mui/material/TableHead";
import TableRow from "@mui/material/TableRow";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";

const RolesPage = () => {
  const navigate = useNavigate();
  // const [roles, setRoles] = useState([]); // State to store roles data
  const [listData, setListData] = useState([]);
  const [searchTerm, setSearchTerm] = useState(""); // State for search functionality

  // Fetch the list of user roles
  useEffect(() => {
    getUserRoles();
  }, []);

  const getUserRoles = async () => {
    try {
      const response = await axios.get(
        "http://localhost:8080/auth/list-userrole"
      );
      console.log("Fetched data:", response?.data?.data);
      setListData(response?.data?.data || []);
    } catch (error) {
      console.error("Error fetching user roles:", error);
    }
  };
  // const filteredRoles = roles.filter((role) =>
  //   role.name.toLowerCase().includes(searchTerm.toLowerCase())
  // );

  return (
    <div className="roles-container">
      <header className="roles-header">
        <h2>UserRole</h2>
        <div className="search-and-add">
          <input
            type="text"
            placeholder="Search..."
            className="search-bar"
            value={searchTerm}
            onChange={(e) => setSearchTerm(e.target.value)}
          />
          <Link to="/add-user-role" className="add-new-btn">
            Add UserRole
          </Link>
        </div>
      </header>
      <table className="roles-table">
        <thead>
          <tr>
            <th>Sr. No.</th>
            <th>Name</th>
            <th>Mobile</th>
            <th>Email</th>
            <th>Role</th>
            <th>Status</th>
            <th>Action</th>
          </tr>
        </thead>
        <tbody>
          {listData.length > 0 ? (
            listData.map((role, index) => (
              <tr key={role._id || index}>
                <td>{index + 1}</td>
                <td>{role.name}</td>
                <td>{role.mobile}</td>
                <td>{role.email}</td>
                <td>{role.role}</td>
                <td
                  className={
                    role.isActive ? "status-active" : "status-inactive"
                  }
                >
                  {role.isActive ? "Active" : "Inactive"}
                </td>
                <td className="actions">
                  <Link to={"/edit-user"} state={role._id}>
                    <Button variant="primary" className="edit-btn">
                      Edit
                    </Button>
                  </Link>
                  <Button
                    variant="danger"
                    className="delete-btn"
                    onClick={() => {
                      // Add delete functionality here
                      alert(`Delete role with ID: ${role._id}`);
                    }}
                  >
                    Delete
                  </Button>
                </td>
              </tr>
            ))
          ) : (
            <tr>
              <td colSpan={4} align="center">
                No roles available.
              </td>
            </tr>
          )}
        </tbody>
      </table>
    </div>
  );
};

export default RolesPage;
